import React from "react" 
import Typewriter from "typewriter-effect/dist/core"

 const Home = () => {
    return (
      <div className="type-writer-container">
        <h1>Welcome to my portfolio
          <Typewriter
          options={{
            autoload: true,
            loop: true,
            delay: 50,
          }}
          />  
        </h1>
      </div>
    )
 }
export default Home
